updateData.functionBody:
var output = {};
var trans = {};
output.translations = trans;

var prefixSuffixMap = getPrefixSuffixMap();

for(var key in downloadedStrings.translations) {
    var entry = downloadedStrings.translations[key];
    var sepChar = key.indexOf(":");
    var keyPrefix = key.substr(0,sepChar);
    var keySuffix = key.substr(sepChar+1);
    if(keyPrefix == "state") {
        key = getProperKey(keySuffix,prefixSuffixMap);
    }
    trans[key] = entry;
}

return output;

updateData.supplementalCode:
function getPrefixSuffixMap() {
    var output = {};

    var countryKey = presets_Standard.named_groups["post address"][0];
    for(var countryName in countryKey.v) {
        var countryEntry = countryKey.v[countryName];
        if(countryEntry.ks) {
            var adminKey = countryEntry.ks[0];
            var adminType = adminKey.k;
            for(var adminName in adminKey.v) {
                output[adminName] = adminType;
            }
        }
    }
    return output;
}


function getProperKey(keySuffix,prefixSuffixMap) {
    console.log("key suffix = " + keySuffix);
    var prefix = prefixSuffixMap[keySuffix];
    console.log("key prefix = " + prefix);
    return prefix + ":" + keySuffix;

}
